import React, { useEffect, useRef, useState } from 'react';
import { makeStyles, useTheme } from '@mui/styles';
import { styled, alpha } from '@mui/material/styles';
import { Link, useNavigate, useLocation } from 'react-router-dom';
import CancelIcon from '@mui/icons-material/Cancel';
import { Grid, IconButton, Typography } from '@mui/material';

const useStyles = makeStyles(theme => ({
    mx2: {
        marginLeft: '1.5rem',
        marginRight: '1.5rem'
    },
    py1: {
        paddingBottom: '0.5rem',
        paddingTop: '0.5rem',
        borderBottom: `1px solid ${theme.palette.background.midGrey}`
    },

}));

function SearchList({ list, search }) {
    const classes = useStyles();
    const location = useLocation();
    const navigate = useNavigate();

    const renderRow = searchItem => {
        return (
            <Grid container justifyContent="space-between" alignItems="center" className={classes.py1}>
                <Grid item xs={10} onClick={() => search(searchItem)} className={classes.mx2}>
                    <Typography c color="textSecondary">
                        {searchItem}
                    </Typography>
                </Grid>
            </Grid>
        )
    };


    return (
        <Grid container justifyContent="flex-start" alignItems="center">
            {list.map(item => renderRow(item))}
        </Grid>
    );
}

export default SearchList;
